import React from "react";

const Socials = () => {
  return (
    <div>
      <div className="socials">
        <img src="https://www.iconpacks.net/icons/2/free-instagram-logo-icon-3497-thumb.png"></img>
        <img src="https://upload.wikimedia.org/wikipedia/commons/0/0c/Facebook%2BIcon%2BBlack.png"></img>
        <img src="https://seeklogo.com/images/L/linkedin-logo-A6EF048412-seeklogo.com.png"></img>
        <img src="https://cdn-icons-png.flaticon.com/512/60/60580.png"></img>
        <img src="https://static.vecteezy.com/system/resources/thumbnails/023/986/739/small_2x/youtube-logo-youtube-logo-transparent-youtube-icon-transparent-free-free-png.png"></img>
      </div>
      <p className="precautions">
        Do not share or forward to people under legal drinking age. Enjoy
        responsibly and in moderation.
      </p>
    </div>
  );
};

export default Socials;
